import $api from "../services/index";

export const getAllTests = async () => {
  const { data } = await $api.get("/test/getAll");
  return data;
};

export const getQuestionsByTestId = async TestId => {
         const { data } = await $api.get("/question/findQuestions", {
           TestId
         });
         return data;
       };
